.keys(consentGroupIsAllowed)
.map(function (purpose) {
var result = {};
result[purpose] = consentObject.groups.indexOf(consentGroupIsAllowed[purpose]) > -1;
return result;
})
.reduce(
function (result, currentValue) {
return Object.assign(result, currentValue);
}, {
functional: true
}
);
}
}
