queueTimeout = setTimeout(flush, flushInterval);
}
queue.push(event);
if (queue.length >= flushSize) {
if (queueTimeout !== null) {
clearTimeout(queueTimeout);
}
flush();
return;
}
}
function flush() {
send(queue, true);
queue = [];
queueTimeout = null;
